#include <iostream>#include <vector>#include <algorithm>using namespace std;void test16(){    vector<int> v1;    v1.push_back(1);    v1.push_back(3);    v1.push_back(5);    v1.push_back(7);    v1.push_back(9);    vector<int> v2;    v2.push_back(7);    v2.push_back(9);    v2.push_back(11);    v2.push_back(13);    v2.push_back(15);    vector<int> v3;//存v1差v2集    v3.resize(v1.size() );    vector<int>::iterator ret;    ret = set_difference(v1.begin(),v1.end(), v2.begin(), v2.end(), v3.begin());    copy(v3.begin(), ret, ostream_iterator<int>(cout, " ") );    cout<<endl;}int main(int argc, char *argv[]){    test16();    return 0;}